/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground } from 'docz'
import Button from 'antd/lib/button';
import Divider from 'antd/lib/divider';
import Icon from 'antd/lib/icon';
import Menu from 'antd/lib/menu';
import ButtonTooltip from 'rk-admin-ui/es/button-tooltip';
import PageHeader from '../components/PageHeaderDemo';

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "pageheader"
    }}>{`PageHeader`}</h1>
    <p>{`Panel slides from screen edge with form.`}</p>
    <h2 {...{
      "id": "properties"
    }}>{`Properties`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Property`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Type`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Default`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`isLoading`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`whether the skeleton is visible or not.`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`leftActionControls`}{`|`}{`rightActionControls`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`content of the left `}{`|`}{` right controls`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}{`|`}{`ReactNode`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`popoverDropdownItems`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`content of the card`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}{`|`}{`ReactNode`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`popoverDropdownTrigger`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`whether floating PopoverDropdown by `}<inlineCode parentName="td">{`click`}</inlineCode>{` or `}<inlineCode parentName="td">{`hover`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`click`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`title`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`the title for PageHeader.`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "sample"
    }}>{`Sample`}</h2>
    <Playground __position={0} __code={'<PageHeader\n  isLoading={true}\n  leftActionControls={\n    <>\n      <ButtonTooltip\n        title=\"Edit\"\n        icon=\"edit\"\n        type=\"primary\"\n        shape=\"circle\"\n        className=\"base-margin-right\"\n      />\n      <ButtonTooltip\n        title=\"Active\"\n        icon=\"check\"\n        type=\"primary\"\n        shape=\"circle\"\n        className=\"base-margin-right\"\n      />\n      <ButtonTooltip\n        title=\"Inactive\"\n        icon=\"stop\"\n        type=\"primary\"\n        shape=\"circle\"\n      />\n    </>\n  }\n  popoverDropdownItems={\n    <Menu className=\"popover-dropdown-item\">\n      <Menu.Item key=\"all\">All Categories</Menu.Item>\n      <Menu.Item key=\"active\">Active Categories</Menu.Item>\n      <Menu.Item key=\"inactive\">Inactive Categories</Menu.Item>\n      <Divider style={{ marginTop: 12, marginBottom: 5 }} />\n      <Menu.Item key=\"advanced_search\">\n        <Icon type=\"search\" /> Advanced Search\n      </Menu.Item>\n    </Menu>\n  }\n  rightActionControls={\n    <Button type=\"primary\" icon=\"plus\">\n      New Category\n    </Button>\n  }\n  showAction={true}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Button,
      Divider,
      Icon,
      Menu,
      ButtonTooltip,
      PageHeader
    }} mdxType="Playground">
    <PageHeader isLoading={true} leftActionControls={<>
                <ButtonTooltip title='Edit' icon='edit' type='primary' shape='circle' className='base-margin-right' mdxType="ButtonTooltip" />
                <ButtonTooltip title='Active' icon='check' type='primary' shape='circle' className='base-margin-right' mdxType="ButtonTooltip" />
                <ButtonTooltip title='Inactive' icon='stop' type='primary' shape='circle' mdxType="ButtonTooltip" />
            </>} popoverDropdownItems={<Menu className='popover-dropdown-item' mdxType="Menu">
                <Menu.Item key='all'>All Categories</Menu.Item>
                <Menu.Item key='active'>Active Categories</Menu.Item>
                <Menu.Item key='inactive'>Inactive Categories</Menu.Item>
                <Divider style={{
          marginTop: 12,
          marginBottom: 5
        }} mdxType="Divider" />
                <Menu.Item key='advanced_search'>
                    <Icon type='search' mdxType="Icon" /> Advanced Search
                </Menu.Item>
            </Menu>} rightActionControls={<Button type='primary' icon='plus' mdxType="Button">New Category</Button>} showAction={true} mdxType="PageHeader" />
    </Playground>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
